import React from 'react';
import IndexSection from '../Sections/IndexSection'
import MoreInfoSection from '../Sections/MoreInfoSection';

function HomePage() {


  return (
      <>
       <div class='container'>
    <header>

        <div class='columns'>
            <div clas='column'>

            </div>
        </div>

    </header>

      <section id='index_section'>
        <IndexSection />
      </section>
      <hr />
      <section id='info_section'>
        <MoreInfoSection />
      </section>

    </div>
</>
  );
}

export default HomePage;
